import React from 'react';

import './App.css';
import BoxList from './BoxList';
import Box from './Box';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <BoxList/>
        <Box height={20} width={20} colour='purple'/>
      </header>
    </div>
  );
}

export default App;
